[:div [:big [:big \"...\"]]]]], \"282\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"237\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"207\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"238\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"270\" [:div nil [:div [:big [:big 3]]]], \"231\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(@)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]]], \"251\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"169\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"232\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div nil]], \"274\" [:div [:p/code {:code \"^k/hiccup\\n[:p/leafletmap\\n    {:tile-layer {:url         \\\"https://stamen-tiles-{s}.a.ssl.fastly.net/toner-lite/{z}/{x}/{y}{r}.{ext}\\\"\\n                  :attribution \\\"Map tiles by <a href= \\\\\\\"http://stamen.com\\\\\\\" >Stamen Design</a>, <a href= \\\\\\\"http://creativecommons.org/licenses/by/3.0\\\\\\\" >CC BY 3.0</a> &mdash ; Map data &copy; <a href=\\\\\\\"https://www.openstreetmap.org/copyright\\\\\\\">OpenStreetMap</a> contributors\\\"\\n                  :ext         \\\"png\\\"}}\\n    [{:type   :view\\n      :center [51.49, -0.08]\\n      :zoom   12\\n      :height 600\\n      :width  700}\\n     {:type   :rectangle\\n      :bounds [[51.49, -0.08]\\n               [51.5, -0.06]]}\\n     {:type      :circle\\n      :center    [51.505, -0.09]\\n      :fillColor :blue\\n      :radius    200}\\n     {:type      :polygon\\n      :positions [[51.515, -0.09]\\n                  [51.52, -0.1]\\n                  [51.52, -0.12]]\\n      :color     :purple}\\n     {:type      :polygon\\n      :positions [[[51.51, -0.12]\\n                   [51.51, -0.13]\\n                   [51.53, -0.13]]\\n                  [[51.51, -0.05]\\n                   [51.51, -0.07]\\n                   [51.53, -0.07]]]\\n      :color     :purple}\\n     {:type      :line\\n      :positions [[51.505, -0.09]\\n                  [51.51, -0.1]\\n                  [51.51, -0.12]]\\n      :color     :lime}\\n     {:type      :line\\n      :positions [[[51.5, -0.1]\\n                   [51.5, -0.12]\\n                   [51.52, -0.12]]\\n                  [[51.5, -0.05]\\n                   [51.5, -0.06]\\n ]]]]], \"162\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"192\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"213\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"167\" [:div [:p/code {:code \"(def p2 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"259\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div nil]], \"197\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"249\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"{:x 3}\\n\"}]]]], \"268\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"226\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"228\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"244\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"225\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"203\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"172\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"278\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"176\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"247\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"212\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"199\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"210\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"186\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"261\" [:div nil [:div nil]], \"181\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"284\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"184\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"173\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"246\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"190\" [:div \n     {:type      :line\\n      :positions [[51.505, -0.09]\\n                  [51.51, -0.1]\\n                  [51.51, -0.12]]\\n      :color     :lime}\\n     {:type      :line\\n      :positions [[[51.5, -0.1]\\n                   [51.5, -0.12]\\n                   [51.52, -0.12]]\\n                  [[51.5, -0.05]\\n                   [51.5, -0.06]\\n                   [51.52, -0.06]]]\\n      :color     :lime}\\n     {:type     :marker\\n      :position [51.505, -0.09]}\\n     {:type     :marker\\n      :position [51.51, -0.12]\\n      :popup    \\\"wow\\\"}\\n     {:type      :circlemarker\\n      :center    [51.52, -0.06]\\n      :fillColor :blue\\n      :radius    200\\n      :popup     \\\"square the circle\\\"}]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"276\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"166\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"218\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"194\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"168\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"241\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"257\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"209\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"239\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"240\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"271\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"174\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"171\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"200\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"183\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"223\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"272\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.2512090911735184 0.3986430103274702 0.024137240998288956 -0.3827250283307768 -0.673888698336423 -0.3517657038226528 -0.6332846658036574 -0.953686245472654 -0.9860789787101388 -1.018461062094462 -0.6150738729064471 -0.9918895126876109 -0.6936672552851355 -0.614776362182872 -0.49194511738479785 -0.26358152030208304 -0.3304727756250434 -0.7724945124869551 -1.1758464987470316 -1.2219014320291093 -1.6287334630653456 -1.1974026976942338 -1.19985077463402 -0.7063595970952428 -0.4816739057758237 -0.3272634530441044 -0.6874882871279564 -0.2540783185780624 -0.5016105432975929 -0.3460676841764354 -0.06391624834355136 0.3448851124782498 0.6925292940665294 0.6637564274012788 0.33138074594025857 0.6618330533717406 0.9690511051131728 0.650604619536159 0.4985210179242645 0.5644669436232048 0.7117855305699785 0.5788571346861059 0.7539612130373629 1.1776311208692043 1.100881514470591 1.0782804701511541 0.6593802192018257 1.069960303117183 1.1767738764723532 1.0038285004826712 0.9153802739379384 0.42827534932294675 0.003277979255194574 -0.0812743495695144 -0.4488446975234749 -0.2653764247688428 0.12869809616990113 0.5343435908644308 0.7199141934571256 0.5303183303152967 0.6494273918382151 0.5399205118625897 0.17364081968571266 0.3621961195514778 0.6337640604978897 0.1586128477738049 0.16472248856980176 0.08358059965367237 -0.41042815352035533 -0.7012807459936197 -0.7689145191439654 -0.5488803812315256 -0.8170273887878293 -0.5448293180074506 -0.8092616994858586 -0.4562563213451044 -0.3385257618783776 -0.31845804089395535 -0.17395703583151367 0.05648450038352426 0.5288097052924072 0.12190741152908258 0.3026092983679448 0.11478721651532697 0.08529084186154712 -0.11016287940698422 -0.532561027910596 -0.9607484076293957 -1.3883343843633775 -1.3662904018723305 -1.069166461601561 -1.4085541542728799 -1.6386921349570798 -1.9416964983448666 -1.6183753014976276 -1.226449319826072 -0.7399341500611692 -0.892677142337795 -0.9595147018642881), :svgHeight 20}]]]], \"205\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"287\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"229\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"235\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"206\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"216\" [:div nil [:div [:div [:big [:big \"...\"]]
